<?php
date_default_timezone_set('UTC');
require '../includes/PHPMailer/PHPMailerAutoload.php';
require '../includes/logins.php';

$Subject = [['contact@asbf.fr', 'Bureau ASBF'], ['secretaire@asbf.fr', 'Secrétaire ASBF'], ['tresorier@asbf.fr', 'Trésorier ASBF'], ['tech@asbf.fr', 'Technique ASBF'], ['contact@asbf.fr', 'Général ASBF']];

$i = Trim(stripslashes($_POST['select'])) - 1;
$Name = Trim(stripslashes($_POST['nom']));
$Email = Trim(stripslashes($_POST['email']));
$Message = '<img src="data:image/png;base64,"/>';
$Message .= "<br><b>De :</b> ". $Name ." - <a href='mailto:". $Email ."'>". $Email ."</a><br><b>Message :</b><br>";
$Message .= Trim(stripslashes($_POST['message']));
$Bot = Trim(stripslashes($_POST['captcha']));
$SendSelf = Trim(stripslashes($_POST['self']));

$Message = utf8_decode($Message);

if(!empty($Bot) OR $i < 0) {
    print "<meta http-equiv=\"refresh\" content=\"0;URL=./?bot\">";
} else {
    $mail = new PHPMailer();
    $mail->isSMTP();
	$mail->setLanguage('fr');

    // 0 = off (for production use)
    // 1 = client messages
    // 2 = client and server messages
    $mail->SMTPDebug = 0;
    $mail->Debugoutput = 'html';

    $mail->Host = $mailHost;
    $mail->Port = $mailPort;
    $mail->SMTPSecure = 'ssl';
    $mail->SMTPAuth = true;
    $mail->Username = $mailUser;
    $mail->Password = $mailPass;
    
    $mail->From = $mailUser;
	$mail->FromName = 'Contact Web ASBF';
    $mail->addReplyTo($Email, $Name);
    $mail->addAddress($Subject[$i][0], $Subject[$i][1]);
    if($SendSelf) $mail->addCC($Email);
    
    $mail->isHTML(true);
    $mail->Subject = "[". $Subject[$i][1] ."] Message de ". $Name ." <". $Email .">";
    $mail->Body = nl2br($Message);
    $mail->AltBody = $Message;

    //send the message, check for errors
    if (!$mail->send()) {
        print "<meta http-equiv=\"refresh\" content=\"0;URL=./?error=". urlencode($mail->ErrorInfo) ."\">";
    } else {
        print "<meta http-equiv=\"refresh\" content=\"0;URL=./?success\">";
    }
}
